function onCreate()for i = 0, getProperty('unspawnNotes.length')+1 doif getPropertyFromGroup('unspawnNotes', i, 'noteType') == 'podoboo' then -- try name in file in same name (in lua)setPropertyFromGroup('unspawnNotes', i, 'texture', 'podoboo'); -- Change texturesetPropertyFromGroup('unspawnNotes', i, 'ignoreNote', true);endendendfunction note(id, noteData, noteType, isSustainNote)if noteType == 'name' then -- try name in file in same name (in lua)health = getProperty('health')setProperty('health', health + 0)playSound('podoboo.ogg', 1) -- missnote3 will play the sound if the note type gets touched.endend